SELECT PER_PA.CMCD, PER_PA.CYCLE_MTH, PER_PA.AGENT_TYPE, PER_PA.PA_TYPE, PER_PA.CHANNEL, PER_PA.AGY, PER_PA.AGT, PER_PA.CONTRACT_DT, PER_PA.TERM_DT, PER_PA.FYP_CM, PER_PA.RYP_CM, PER_PA.FYP_QTD, PER_PA.RYP_QTD, PER_PA.FYP_YTD, PER_PA.RYP_YTD, PER_PA.FYP_P12, PER_PA.RYP_P12, PER_PA.FYP_CM_LY, PER_PA.RYP_CM_LY, PER_PA.FYP_QTD_LY, PER_PA.RYP_QTD_LY, PER_PA.FYP_YTD_LY, PER_PA.RYP_YTD_LY, PER_PA.FYP_P12_LY, PER_PA.RYP_P12_LY, PER_PA.PER_CM, PER_PA.PER_QTD, PER_PA.PER_YTD, PER_PA.PER_P12, PER_PA.CREATE_DT, PER_PA.CREATE_BY, PER_PA.UPDATE_DT, PER_PA.UPDATE_BY, PER_PA.DISTRICT, IN_ETL_CONTROL.TXT_KEY_VALUE FROM PER_PA, IN_ETL_CONTROL WHERE PER_PA.AGENT_TYPE IN ('01','02','03') AND PER_PA.CMCD IN ('SG','BN') AND TO_CHAR(PER_PA.CYCLE_MTH,'YYYYMM') = TO_CHAR(TO_DATE(IN_ETL_CONTROL.TXT_KEY_VALUE ,'YYYY-MM-DD'),'YYYYMM') AND IN_ETL_CONTROL.TXT_KEY_STRING = 'OPER_CYCLE_DATE'
AND (PER_PA.AGENT_TYPE = '01' AND DECODE(PER_PA.CMCD, 'SG', 'SGT', 'BN', 'BRT') || PER_PA.AGT IN (SELECT NAME FROM CS_POSITION WHERE EFFECTIVESTARTDATE <= TO_DATE(IN_ETL_CONTROL.TXT_KEY_VALUE, 'YYYY-MM-DD') AND EFFECTIVEENDDATE > TO_DATE(IN_ETL_CONTROL.TXT_KEY_VALUE, 'YYYY-MM-DD') AND REMOVEDATE = TO_DATE('22000101', 'YYYYMMDD')) OR PER_PA.AGENT_TYPE IN ('02', '03') AND DECODE(PER_PA.CMCD, 'SG', 'SGY', 'BN', 'BRY') || PER_PA.AGY IN (SELECT NAME FROM CS_POSITION WHERE EFFECTIVESTARTDATE <= TO_DATE(IN_ETL_CONTROL.TXT_KEY_VALUE, 'YYYY-MM-DD') AND EFFECTIVEENDDATE > TO_DATE(IN_ETL_CONTROL.TXT_KEY_VALUE, 'YYYY-MM-DD') AND REMOVEDATE = TO_DATE('22000101', 'YYYYMMDD'))
)

UPDATE IN_ETL_CONTROL SET DEC_RUNNING_FLG = 1 WHERE TXT_KEY_STRING LIKE '$$STR_RUNNING_FLAG'; COMMIT;
UPDATE IN_ETL_CONTROL SET TXT_KEY_VALUE=(SELECT LPAD(TO_CHAR(COUNT(*)*4),10,'0') FROM PER_PA ,IN_ETL_CONTROL WHERE PER_PA.AGENT_TYPE IN ('01','02','03') AND PER_PA.CMCD IN ('SG','BN') AND (PER_PA.AGENT_TYPE = '01' AND DECODE(PER_PA.CMCD, 'SG', 'SGT', 'BN', 'BRT') || PER_PA.AGT IN (SELECT NAME FROM CS_POSITION WHERE EFFECTIVESTARTDATE <= TO_DATE(IN_ETL_CONTROL.TXT_KEY_VALUE, 'YYYY-MM-DD') AND EFFECTIVEENDDATE > TO_DATE(IN_ETL_CONTROL.TXT_KEY_VALUE, 'YYYY-MM-DD') AND REMOVEDATE = TO_DATE('22000101', 'YYYYMMDD')) OR PER_PA.AGENT_TYPE IN ('02', '03') AND DECODE(PER_PA.CMCD, 'SG', 'SGY', 'BN', 'BRY') || PER_PA.AGY IN (SELECT NAME FROM CS_POSITION WHERE EFFECTIVESTARTDATE <= TO_DATE(IN_ETL_CONTROL.TXT_KEY_VALUE, 'YYYY-MM-DD') AND EFFECTIVEENDDATE > TO_DATE(IN_ETL_CONTROL.TXT_KEY_VALUE, 'YYYY-MM-DD') AND REMOVEDATE = TO_DATE('22000101', 'YYYYMMDD')) ) AND TO_CHAR(PER_PA.CYCLE_MTH,'YYYYMM') = TO_CHAR(TO_DATE(IN_ETL_CONTROL.TXT_KEY_VALUE ,'YYYY-MM-DD'),'YYYYMM') AND IN_ETL_CONTROL.TXT_KEY_STRING = 'OPER_CYCLE_DATE'), DTE_UPDATE_DATE=SYSDATE WHERE TXT_KEY_STRING='PAPER_PRESTAGE_RECORD_COUNT' AND DEC_RUNNING_FLG=1;
COMMIT;
